import React from "react";
import DonationImg from "../Donation/image/donation-dog.png"

const Donation = () => {
  return(
    <select className="donation">
      <div className="container">
        <div className="donation__wrapper">
          <div className="donation__img">
            <img src={DonationImg} alt="Donation dog" />
          </div>
          <div className="donation__content">

            <h1 className="donation__title">
            You can also make a donation
            </h1>

            <p className="donation__desc">
            Name of the bank / Type of bank account
            </p>

            <div className="donation__card">
              
            </div>
          </div>
        </div>
      </div>
    </select>
  );
};

export default Donation;
